import React from 'react';
import './Timetable.css';

function Table () {
  const daysOfWeek = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday'];
  const hours = ['I','II', 'III',' ', 'IV',' ',' ', 'V', 'VI', 'VII']
  const timeSlots = ['8:40 AM - 9:35 AM', '9:35 AM - 10:30 AM', '10:30 AM - 11:25 AM', '11:25 AM - 11:45 AM', '11:45 AM - 12:40 AM', '12:40 PM - 12:55 PM', '12:55 PM - 1:40 PM', '1:40 PM - ', '2:30 PM', '3:20 PM', '4:10 PM'];

  return (
    <div className="college-timetable">
      <table>
        <thead>
          <tr>
            <th>Time</th>
            {hours.map((day, index) => (
              <th key={index}>{day}</th>
            ))}
          </tr>
          <tr>
            <th>Time</th>
            {timeSlots.map((day, index) => (
              <th key={index}>{day}</th>
            ))}
          </tr>

        </thead>
        <tbody>
          {timeSlots.map((time, timeIndex) => (
            <tr key={timeIndex}>
              <td>{time}</td>
              {daysOfWeek.map((day, dayIndex) => (
                <td key={dayIndex}></td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Table;
